INSERT INTO `comics` VALUES (1,'Cơ Giới Thiếu Nữ','co-gioi-thieu-nu','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/1/co-gioi-thieu-nu_1666803264.jpg','Đang Cập Nhật','Thế giới đã bị nhiễm chướng khí gây ra bởi những con quái vật bí ẩn, thứ duy nhất có thể đối chọi với chúng chính là vũ khí sinh hóa \"Mercy\".','active',1,'2022-10-27 15:32:19','2022-10-27 15:32:22'),(2,'Dã Nhân Tái Sinh','da-nhan-tai-sinh','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/2/da-nhan-tai-sinh_1666069182.jpg','Đang Cập Nhật','Tôi bất ngờ lìa đời.Rồi gặp phải một tên thần linh nửa vời, sau màn chào hỏi nửa vời, tôi bị hắn đẩy xuống một vùng rừng rú hoang dã. Không có phép thuật. Không cheat gì luôn. Thứ duy nhất tôi có thể dựa vào chỉ là trí khôn cùng với karate của mình. Mọi điều còn lại là bảo vệ bản thân trước thế giới mới khắc nghiệt này!!','active',2,'2022-10-27 15:50:18','2022-10-27 15:50:19'),(3,'Đội Đốt Kích Noryangjin','doi-dot-kich-noryangjin','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/3/doi-dot-kich-noryangjin_1666741902.jpg','Đang Cập Nhật','Ji Geon – người đã trượt kỳ thi tuyển sinh vào đại học không biết bao nhiêu lần chỉ vì quá mải mê chơi game. Một ngày nọ, cậu thức dậy và ước gì cuộc sống đời thường trở thành trò chơi. Và rồi, điều đó đã trở thành hiện thực…! Thế giới bỗng chốc trở thành địa ngục. Trong thế giới đã trở thành một trò chơi, Ji Geon đã bắt đầu cuộc đột kích để giải cứu nhân loại!','active',1,'2022-10-27 15:54:11','2022-10-27 15:54:11'),(4,'Gokusotsu Kraken','gokusotsu-kraken','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/4/gokusotsu-kraken_1665838455.jpg','Đang Cập Nhật','Cùng tác giả với Akame ga Kill và Mato Seihei no Slave. Một cậu thanh niên tên Shimizu Kuuma đang phải lo lắng để tìm kiếm việc làm thì đột nhiên bị đưa sang một thế giới khác. Sau đó cậu bị đưa vào hải ngục thành - nhà tù giữa biển cả dành cho nữ giới. Ở đó cậu đã hợp nhất mới chúa tể biển cả Kraken - một sinh vật đã giao cho cậu nhiệm vụ phải đi giải cứu công chúa Zeina.','active',1,'2022-10-27 15:56:10','2022-10-27 15:56:10'),(5,'Hỏa Long Vainqueur','hoa-long-vainqueur','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/5/hoa-long-vainqueur_1666167689.jpg','Đang Cập Nhật','Vainqueur Knightsbane là một con rồng chuẩn mực: một con thằn lằn thở ra lửa thích nằm ngủ trên kho báu của mình, bắt cóc công chúa cho vui, và làm những kẻ phiêu lưu phải khốn khổ. Thú vui duy nhất của nó là nhìn kho báu của mình to lớn lên, từng đồng vàng một. Nên khi một tên trộm tự xưng trở thành thuộc hạ ngoài ý muốn nói với nó về “cấp bậc”, “tầng lớp”, và “thám hiểm”, Vainqueur phải suy nghĩ là không biết có nên thay đổi sự nghiệp của mình không. Thế giới liệu có thể vượt qua con rồng đầu tiên có sức mạnh to lớn không?','active',1,'2022-10-27 15:58:44','2022-10-27 15:58:44'),(6,'Sống Như Một Diễn Viên','song-nhu-mot-dien-vien','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/6/song-nhu-mot-dien-vien_1665973284.jpg','Đang Cập Nhật','Nam diễn viên \'Jang Young-guk\', người đã đạt được thành công lớn với vai trò diễn viên phụ. Nhận giải Nam diễn viên phụ xuất sắc nhất đầu tiên và danh giá tại Giải thưởng Diễn xuất. Tuy nhiên, vào ngày đó, mẹ anh đã qua đời… Kinh hoàng trước cái chết của mẹ mình, người mà anh đã bỏ rơi trong nhiều năm, Young-guk quyết định kết liễu cuộc đời mình… Trước khi chết, anh nhớ lại hơi ấm của mẹ và những kỷ niệm êm đềm ngày xưa. Anh hối hận khi quay lưng lại với những ký ức đó… Và đột nhiên quay trở lại thời thơ ấu của mình… \"Tôi đã trở lại, về quá khứ mà tôi đã bỏ lỡ\" “Như một sự thật không thể tránh khỏi, cuộc sống này là…” Một lần nữa, câu chuyện của một người muốn sống như một diễn viên bắt đầu. Liệu anh có thể sống một cuộc sống hạnh phúc không giống như kiếp trước?','active',1,'2022-10-27 16:02:13','2022-10-27 16:02:14'),(7,'Lựa Chọn Thần Cấp: Ta Không Theo Sáo Lộ Mạnh Lên','lua-chon-than-cap-ta-khong-theo-sao-lo-manh-len','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/7/lua-chon-than-cap-ta-khong-theo-sao-lo-manh-len_1665219647.jpg','Đang Cập Nhật','Đinh đinh! Hệ thống nhắc nhở: Đối mặt tông môn đệ tử khiêu chiến, mời túc chủ lựa chọn cho hắn một cái ôm một cái —— Ban thưởng Linh Hải đan một viên. Đinh đinh! Hệ thống nhắc nhở: Tông môn đệ tử gặp phục kích, mời túc chủ lựa chọn nhanh lên chạy trốn —— Ban thưởng cao cấp đan dược một viên. Rừng cũng ngoài ý muốn đạt được lựa chọn hệ thống, vốn cho rằng sẽ nhất phi trùng thiên, kết quả hệ thống khóa lại phạm sai lầm, thế là mở ra một cái khác loại tu luyện hình thức.','active',2,'2022-10-27 16:09:30','2022-10-27 16:09:31'),(8,'Chặt Củi 10 Năm, Tiên Tử Cầu Xin Ta Thu Nàng Làm Đồ Đệ','chat-cui-10-nam-tien-tu-cau-xin-ta-thu-nang-lam-do-de','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/8/chat-cui-10-nam-tien-tu-cau-xin-ta-thu-nang-lam-do-de_1665654632.jpg','Đang Cập Nhật','Truyện tranh Chặt Củi 10 Năm, Tiên Tử Cầu Xin Ta Thu Nàng Làm Đồ Đệ được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Chặt Củi 10 Năm, Tiên Tử Cầu Xin Ta Thu Nàng Làm Đồ Đệ.','active',2,'2022-10-27 16:14:56','2022-10-27 16:14:57'),(9,'Phù Thạch Vương Giả','phu-thach-vuong-gia','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/9/phu-thach-vuong-gia_1664886628.jpg','Đang Cập Nhật','Truyện tranh Phù Thạch Vương Giả được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Phù Thạch Vương Giả.','active',2,'2022-10-27 16:21:01','2022-10-27 16:21:02'),(10,'Chí Tôn Hoàn Mỹ','chi-ton-hoan-my','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/10/chi-ton-hoan-my_1664883410.jpg','Đang Cập Nhật','Thời đại thiên vận, võ đạo tung hoành! Thiếu niên lâm lăng từ nhỏ bị phong ấn, nhận hết khinh nhục, đương một đôi thần bí tròng mắt thức tỉnh khi, đã từng cường giả, cổ xưa thần thoại, thần bí di tích xuất hiện ở hắn hai mắt! Hắn thấy được mất đi thời gian, thấy được viễn cổ thần ma bí mật, hắn thấy được cổ đại đỉnh giai công pháp, sở hữu biến mất ở lịch sử sông dài cường giả, toàn bộ bị hắn thấy được, nương cổ đại cường giả chỉ điểm, hắn từ nhỏ bé con kiến thế giới tầng dưới chót, một bước một cái dấu chân, đi lên tỉ liếc thiên hạ chi lộ.','active',2,'2022-10-27 16:26:41','2022-10-27 16:26:42'),(11,'Tôi Thăng Cấp Bằng Cách Thưởng Cho Những Đệ Tử','toi-thang-cap-bang-cach-thuong-cho-nhung-de-tu','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/11/toi-thang-cap-bang-cach-thuong-cho-nhung-de-tu_1665897526.jpg','Đang Cập Nhật','Sư phó giá hạc tây thiên, kẻ thù tìm tới môn phái làm sao bây giờ?! Thức tỉnh thụ đồ phản lợi hệ thống, nhận đồ đệ càng nhiều, lợi ích sư phó càng nhiều! Ha ha ha, các đồ nhi ngoan, mau tới đây, vi sư chưa bao giờ tàng tư!','active',2,'2022-10-27 20:04:50','2022-10-27 20:04:52'),(12,'Tài Khoản Này Có Độc','tai-khoan-nay-co-doc','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/12/tai-khoan-nay-co-doc_1665838253.jpg','Đang Cập Nhật','Vừa sáng tạo cái tài khoản phụ không bao lâu Lộ Tầm, xuyên không đến « Thiên Trần » khoản này tiên hiệp loại trò chơi, rõ ràng là cái người chơi, lại mạc danh kỳ diệu mang theo NPC mô bản. Về phần chân chính người chơi, thì sẽ tại ba năm sau hàng lâm. Bây giờ, hắn đầu tiên phải đối mặt là... Một cái muốn đem hắn bắt đi làm lô đỉnh nữ ma đầu! ... \"Tài khoản này thật sự có chút độc a!\" Lộ Tầm.','active',3,'2022-10-27 20:08:20','2022-10-27 20:08:21'),(13,'Trong Game Ta Là Vô Địch','trong-game-ta-la-vo-dich','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/13/trong-game-ta-la-vo-dich_1665974029.jpg','Đang Cập Nhật','Người chơi chuyên nghiệp Lục Trần đã buộc phải xóa tài khoản của mình và nghỉ game. Do tai nạn xe hơi khiến phản ứng của anh chậm hơn so với người bình thường. Nhưng thông qua game, anh đã được gặp bạn gái mình ở ngoài đời thật, trong lúc hẹn hè anh và cô gái bị một đám côn đồ phục kích và bị ném xuống một dòng nước thải bị. Chuyện gì đã xảy ra với Lục Trần, bạn gái cậu liệu còn sống???','active',3,'2022-10-27 20:12:49','2022-10-27 20:12:49'),(14,'Tử Giới, Thức Tỉnh Tài Năng Hạng Sss','tu-gioi-thuc-tinh-tai-nang-hang-sss','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/14/tu-gioi-thuc-tinh-tai-nang-hang-sss_1666052053.jpg','Đang Cập Nhật','Hàng chục tỷ người trên khắp thế giới bị triệu hồi đến một thế giới khác gọi là tử giới. Trong đó có Lam Tinh Long Quốc ! Nơi có main chính Tần Phong! Cậu đã thức tỉnh năng lực cấp SSS \"Trích xuất vô tận\"! Kĩ năng đó là gì mà khiến thần quỷ cũng phải trao đảo! Bây giờ hãy bắt đầu chế độ miểu sát tử giới!','active',3,'2022-10-27 20:21:17','2022-10-27 20:21:17'),(15,'Thân Là Phản Diện, Ta Đi Bán Hành Cho Nhân Vật Chính','than-la-phan-dien-ta-di-ban-hanh-cho-nhan-vat-chinh','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/15/than-la-phan-dien-ta-di-ban-hanh-cho-nhan-vat-chinh_1666576803.jpg','Đang Cập Nhật','Tô không bờ xuyên qua đến huyền huyễn thế giới, trở thành thượng cổ gia tộc Tô gia đạo tử. Không nghĩ tới hắn xuyên qua về sau, tự mang một cái lời bộc bạch. Vốn cho rằng cái này lời bộc bạch là kim thủ chỉ, không nghĩ tới lại tại mỗi giờ mỗi khắc nhả rãnh mình. Hạ giới lịch luyện thời điểm, lại thật vừa đúng lúc phát hiện mình lại là cái nhân vật phản diện! Đúng lúc này, lời bộc bạch mưa đạn ngoài ý muốn giải tỏa nhắc nhở công năng. Chỉ cần chèn ép khí vận chi tử, liền có thể dùng đến đến nhân vật phản diện giá trị xem xét nhắc nhở!','active',3,'2022-10-27 20:26:11','2022-10-27 20:26:12'),(16,'Thợ Săn Top 1 Trở Lại','tho-san-top-1-tro-lai','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/16/tho-san-top-1-tro-lai_1666169093.jpg','Đang Cập Nhật','Noah, người từng là một thợ săn cấp S, đã phong ấn sức mạnhcủa mình sau khi anh ta vô tình giết chết người bạn thân nhất. Kể từ đó, anh ta trở thành một bác sĩ ít người biết đến trong một thị trấn nhỏ. Một cuộc gặp gỡ tình cờ với một thợ săn khác, Xia Zuo, khiến anh ta phát hiện ra rằng người bạn thân nhất của anh ta có thể không nhất thiết phải chết. Cùng nhau, Noah và Xia Zuo bắt đầu cuộc hành trình khám phá những bí ẩn của quá khứ.','active',3,'2022-10-27 20:31:23','2022-10-27 20:31:23'),(17,'Trò Chơi Này Không Đơn Giản','tro-choi-nay-khong-don-gian','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/17/tro-choi-nay-khong-don-gian_1666225298.jpg','Đang Cập Nhật','Trò chơi 3D《 Hư thực huyễn cảnh 》 Bên trong, các người chơi có thể tiến vào khác biệt phong cách phó bản, phân phối đến ngẫu nhiên thân phận tiến hành lẫn nhau chém giết, thủ đoạn không hạn chế, thắng lợi điều kiện chỉ có một cái: Tiêu diệt tất cả đối địch người chơi. Cao chơi Phương Nghĩa người khoác áo lót tiến vào tân thủ phó bản, hắn muốn lợi dụng yếu đuối trò chơi thân phận cùng người chơi khác đấu trí đấu dũng, cầm xuống thắng lợi cuối cùng......','active',3,'2022-10-27 20:36:40','2022-10-27 20:36:42'),(18,'Cao Thủ Gian Lận Hoàn Lương','cao-thu-gian-lan-hoan-luong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/18/cao-thu-gian-lan-hoan-luong_1665762483.jpg','Đang Cập Nhật','Sun Ran, người sinh ra trong một khu ổ chuột, là một bậc thầy trong việc gian lận trong các trò chơi. Dưới vỏ bọc của vô số danh tính, anh ta vô tư lướt qua vô số lời nói ảo. Bất ngờ thay, anh ta bị một Enforcer đuổi ra khỏi thế giới ảo, và thấy mình đang mắc một khoản nợ kếch xù lên tới 900 triệu trong thế giới thực. Để trả nợ, Sun Ran đã thỏa thuận với Trung tâm AI và tự mình trở thành Người thực thi. Vì vậy, bắt đầu cuộc chiến khốc liệt của anh ấy chống lại ‘Kẻ hủy diệt’, những người chơi gian lận trong lối chơi của họ.','active',4,'2022-10-27 20:43:11','2022-10-27 20:43:12'),(19,'Ma Thú Siêu Thần','ma-thu-sieu-than','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/19/ma-thu-sieu-than_1664880426.jpg','Đang Cập Nhật','Truyện tranh Ma Thú Siêu Thần được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Ma Thú Siêu Thần.','active',4,'2022-10-27 20:49:35','2022-10-27 20:49:36'),(20,'Náo Động Thiên Khởi','nao-dong-thien-khoi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/20/nao-dong-thien-khoi_1664881224.jpg','Đang Cập Nhật','Truyện tranh Náo Động Thiên Khởi được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Náo Động Thiên Khởi.','active',4,'2022-10-27 20:54:21','2022-10-27 20:54:22'),(21,'Vạn Đạo Chúa Tể','van-dao-chua-te','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/21/van-dao-chua-te_1664764526.jpg','Đang Cập Nhật','Đông Đường Lăng Tiêu bởi vì phụ thân chuẩn bị cho hắn ngộ đạo loại không cách nào tu luyện, cừu nhân gây chuyện, ta lại trời sinh phế thể? May mắn bá đạo Nữ Hoàng cứu mạng, chờ ta thức tỉnh ngộ đạo loại, đừng nói Liệt Dương Tông, ba ngàn thế giới Thiên Uyên ta cũng đánh xuyên qua nó! ( Người khác có treo, ta có ngộ đạo cây, lão ba ngươi sẽ không lừa ta đúng không?!)','active',4,'2022-10-27 20:59:47','2022-10-27 20:59:47'),(22,'Chủ Nhân Quá Mạnh Nhưng Nhút Nhát','chu-nhan-qua-manh-nhung-nhut-nhat','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/22/chu-nhan-qua-manh-nhung-nhut-nhat_1664614104.jpg','Đang Cập Nhật','Main chuyển sinh thành skeleton. Một thế giới mới, một con người mới. Oh hệ thống anh hùng sao, hệ thống quỷ vương nữa, điều gì sẽ xảy ra với main, hãy cùng nhau theo dõi truyện.','active',4,'2022-10-27 21:06:32','2022-10-27 21:06:35'),(23,'U Nhân','u-nhan','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/23/u-nhan_1664293364.jpg','Đang Cập Nhật','Truyện tranh U Nhân được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện U Nhân.','active',4,'2022-10-27 21:12:06','2022-10-27 21:12:07'),(24,'Tôi Tiến Hóa Sau Khi Ăn Thịt Quỷ Vương','toi-tien-hoa-sau-khi-an-thit-quy-vuong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/24/toi-tien-hoa-sau-khi-an-thit-quy-vuong_1662351614.jpg','Đang Cập Nhật','Độc Nhất vô tình bước vào khu vực cấm và rơi xuống một hố sâu! Vì tình cảm với người bạn thơ ấu anh tìm mọi cách sống sót. Để sống sót tình cờ anh ăn phải xác chết của quỷ vương và tiến hóa.','active',5,'2022-10-27 21:17:11','2022-10-27 21:17:12'),(25,'Đại Đạo Tranh Phong','dai-dao-tranh-phong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/25/dai-dao-tranh-phong_1651466838.jpg','Đang Cập Nhật','Từ xưa tu tiên chi đồ, đều bị bị huyền môn thế gia sở cầm giữ, cũng không phàm dân có khả năng ngấp nghé.Đến từ tận thế thế giới Trương Diễn, đạt được một khối thần bí tàn ngọc trợ giúp, nhưng lại muốn dùng phàm dân chi thân nghịch mà tranh phong, thề phải bước ra một đầu thuộc về mình trường sinh đại đạo!Cấp bậc phân chia: Minh Khí, Huyền Quang, Hóa Đan, Nguyên Anh, Tượng Tương, Phàm Thuế, Chân Dương, Luyện Thần, Chí Nhân','active',5,'2022-10-27 21:25:07','2022-10-29 16:46:59'),(26,'Hồi Ký Của Huyền Thoại Học Giả','hoi-ky-cua-huyen-thoai-hoc-gia','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/26/hoi-ky-cua-huyen-thoai-hoc-gia_1667021390.jpg','Đang Cập Nhật','Kim Si-seup, một chàng trai mang sứ mệnh chiến đấu với các thế lực từ thế giới khác đến suốt cuộc đời. Khi còn nhỏ, người ta đồn rằng anh là thần đồng, nhưng số phận không đứng về phía anh. Anh ấy đến thăm người họa sĩ để tìm ra danh tính của người phụ nữ xuất hiện trong giấc mơ của anh hàng đêm. Chỉ để rồi nghe được những điều mà anh không thể hiểu được… “Thế giới không phải là tất cả những gì ta thấy.  Có thể có một thế giới khác mà chúng ta chưa biết đến … Đây chính là loại truyện kể ấy. ” Khi sống trong thế giới này, anh nhận ra sự tồn tại của một thế giới khác. Anh, một chàng trai đã đấu tranh thảm thương để bảo vệ sự sống và trật tự của thế giới này.  Câu chuyện về “Kim Si-seup” bắt đầu!  Đây là một manhwa lịch sử giả tưởng đan xen giữa Joseon và Seoul!','active',5,'2022-10-29 22:19:10','2022-10-29 22:19:12'),(27,'Thiện Chiến','thien-chien','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/27/thien-chien_1667031789.jpg','Đang Cập Nhật','Nam Triều Tiên năm XXXX đã phát hành một bộ luật mới: Ở 1 số khu phố được gọi là \"vùng chiến\" mặt bằng sẽ được quyết định bởi những kẻ mạnh. Woo BongJun - Chủ của 1 quán ăn nhỏ đang nổi tiếng trên internet đã xui xẻo bị kéo vào cuộc chiến tranh giành mặt bằng này. Vốn xuất thân từ 1 gia đình nghèo, Woo BongJun đã cố gắng hết sức đến mức phải làm nhiều công việc cùng 1 lúc chỉ với hi vọng cứu được người mẹ đang bệnh nặng của mình. Ngỡ đâu hi vọng sẽ được thắp lên khi quán ăn của cậu trở nên nổi tiếng thế nhưng với điều luật mới này, liệu Woo BongJun - người chỉ tin tưởng vào bản thân mình có thể giữ được an toàn cho quán ăn nhỏ của mình hay không?','active',5,'2022-10-29 22:23:10','2022-10-29 22:23:11'),(28,'Xây Dựng Địa Ngục','xay-dung-dia-nguc','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/28/xay-dung-dia-nguc_1665467513.jpg','Đang Cập Nhật','Lee Eun Woo, một nam sinh vốn là con trai của một kẻ s.á.t n.h.â.n, cậu có đã có 1 cuộc sống chẳng khác gì địa ngục khi bị cả xã hội căm ghét và xa lánh. Mỗi ngày đến trường của cậu là thêm 1 ngày trở thành bao cát của bọn bắt nạt, nhưng rồi 1 ứng dụng bí ẩn mang tên \"Xây Dựng Địa Ngục\" đã xuất hiện. Ứng dụng này cho phép Lee Eun Woo có thể trả thù bất kì kẻ nào đã từng chà đạp cậu, thế nhưng cái ứng dụng này liệu có thể mang lại cho Lee Eun Woo cuộc sống hạnh phúc mà cậu hằng mong muốn hay không? Hay sẽ tạo ra 1 con ác quỷ đội lốt người đây?!','active',5,'2022-10-29 22:29:42','2022-10-29 22:29:43'),(29,'Chiến Lược Dị Giới Của Nữ Vương Swarm','chien-luoc-di-gioi-cua-nu-vuong-swarm','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/29/chien-luoc-di-gioi-cua-nu-vuong-swarm_1618157745.jpg','Đang Cập Nhật','Bất ngờ bị chuyển sinh đến dị giới, cô nàng game thủ bất ngờ trở thành nữ vương loài swarm, y như trong game cô từng chơi và hành trình trở thành nữ vương phản diện bắt đầu...','active',5,'2022-10-29 22:35:45','2022-10-29 22:35:46'),(30,'Isekai Tensei De Kenja Ni Natte Bouken-Sha Seikatsu','isekai-tensei-de-kenja-ni-natte-bouken-sha-seikatsu','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/30/isekai-tensei-de-kenja-ni-natte-bouken-sha-seikatsu_1613872335.jpg','Đang Cập Nhật','Main bị toa xe chở hàng đụng chết rồi xuyên không tới thế giới khác. Nơi những Quái vật ma thuật, mà ở thế giới của main đã tuyệt chủng, vẫn còn tồn tại. Main phải làm sao để sống sót trong thế giới cổ đại và lập nên dàn harem bao gồm những em loli đây.','active',5,'2022-10-29 22:41:57','2022-10-29 22:41:58'),(32,'Tự Nhiên Gia Nhập Ma Môn Mất Rồi','tu-nhien-gia-nhap-ma-mon-mat-roi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/32/tu-nhien-gia-nhap-ma-mon-mat-roi_1651144509.jpg','Đang Cập Nhật','Triệu hợp xuyên qua đến một cái tu chân thế giới, không có kim thủ chỉ! Chỉ có thể đem cẩu làm tín điều! Vạn vạn không nghĩ tới cẩu tại trong bụi cỏ cũng có thể đắp lên cổ Ma Quân tàn hồn phụ thể, kết quả biến thành thành một thể song hồn! Tu vi không đủ, Ma Quân chiếm lấy thân thể cưỡng ép tu hành ma công, trực tiếp đột phá. Tu hành tài nguyên không đủ, Ma Quân cưỡng ép đoạt bảo. Đạo lữ không có, Ma Quân trực tiếp cưỡng chiếm đỉnh cấp Thánh nữ của Ma môn đương lô đỉnh. Triệu hợp biểu thị, ta thật là người tốt!','active',6,'2022-10-29 23:00:05','2022-10-29 23:00:06'),(33,'Bị Cắn Thành Vương Giả','bi-can-thanh-vuong-gia','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/33/bi-can-thanh-vuong-gia_1650209441.jpg','Đang Cập Nhật','Sau khi tái sinh, thế giới đã thay đổi. Ma cà rồng đã trở thành chủ nhân của thế giới, và loài người đã hoàn toàn chấp nhận cuộc sống này','active',6,'2022-10-29 23:06:41','2022-10-29 23:06:42'),(34,'Trừ Thần Nhập Hoá','tru-than-nhap-hoa','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/34/tru-than-nhap-hoa_1648282378.jpg','Đang Cập Nhật','Ai nói thần đã biến mất? Ta chính là thần! Lưng mang sứ mệnh cứu vớt thương sinh và thần minh, tru tà khu ác!','active',6,'2022-10-29 23:12:42','2022-10-29 23:12:43'),(35,'Khí Xung Tinh Hà','khi-xung-tinh-ha','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/35/khi-xung-tinh-ha_1645790349.jpg','Đang Cập Nhật','Cổ võ tông sư trẻ tuổi nhất trung quốc - Võ Tinh Hà, bị tổ chức sát thủ Thực Huyết Tường Vi đuổi giết, chiến tử, trọng sinh ở dị thế giới hạ đẳng quý tộc thiếu niên, lần nữa mở ra con đường võ đạo đỉnh phong','active',6,'2022-10-29 23:19:01','2022-10-29 23:19:02'),(36,'Khổng Minh Thích Tiệc Tùng','khong-minh-thich-tiec-tung','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/36/khong-minh-thich-tiec-tung_1579309632.jpg','Đang Cập Nhật','Bậc thầy quân sự nổi tiếng - Gia Cát Lượng Khổng Minh - người đã chết trong trận Ngũ Trượng Nguyên trở lại với cơ thể khi còn trẻ và tái sinh về Nhật Bản hiện đại. Được những người mê tiệc tùng ở Shibuya dẫn đi, Khổng Minh đã tới hộp đêm vang vọng tiếng nhạc EDM. Ở đó Khổng Minh đã gặp Tsukimi Eiko, người có mục tiêu trở thành ca sĩ, chính là người đã vén lên tấm ván cuộc sống thứ hai của ông. Người sống vì thiên hạ thái bình ở thời Tam Quốc như ông sẽ sống gì điều gì đây...!?','active',6,'2022-10-30 11:51:34','2022-10-30 11:51:38'),(37,'Anh Chàng Lầu Trên','anh-chang-lau-tren','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/37/anh-chang-lau-tren_1666349541.jpg','Đang Cập Nhật','Rozy cảm thấy gã hàng xóm lầu trên của cô cứ mờ ám thế nào đó.','active',6,'2022-10-30 12:26:39','2022-10-30 12:26:39'),(38,'Cuồng Thám','cuong-tham','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/38/cuong-tham_1667030456.jpg','Đang Cập Nhật','Triệu Ngọc cứ tưởng rằng mũi thuốc độc trên chiếc ghế tử hình kia đã chấm dứt sinh mạng của hắn, nào ngờ, mở mắt ra đã thấy mình sống lại trong một hình hài khác ở một thế giới khác. Hắn vẫn là Triệu Ngọc, nhưng Triệu Ngọc ở thế giới này không còn là một gã côn đồ sống trên lưỡi đao mũi kiếm nữa mà là một cảnh sát điều tra chính hiệu ba không: không gái gú, không cờ bạc, không rượu chè. Để cảm ơn chủ nhân cơ thể mới, việc đầu tiên hắn làm chính là tạt cà phê vào mặt tên đội phó luôn ức hiếp nguyên chủ, việc thứ hai là đi ăn chơi sung sướng một phen. Nào ngờ chỉ một chuyến đi đến khu đèn đỏ lại giúp hắn khởi động được hệ thống Kỳ Ngộ, còn đụng độ cả tên nghi phạm mà cả đội Trọng án đang truy bắt. Hệ thống Kỳ Ngộ đó là gì? Vì sao nó vừa xuất hiện, Triệu Ngọc đã gặp được tên nghi phạm của vụ án? Điều gì sẽ xảy ra khi một gã côn đồ lại sống lại trong hình hài của một cảnh sát điều tra chân chính?','active',6,'2022-10-30 12:31:34','2022-10-30 12:31:34'),(39,'Dù Có Biết Thành Ác Quỷ, Ta Cũng Phải Tiêu Diệt Ngươi','du-co-biet-thanh-ac-quy-ta-cung-phai-tieu-diet-nguoi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/39/du-co-biet-thanh-ac-quy-ta-cung-phai-tieu-diet-nguoi_1667031089.jpg','Đang Cập Nhật','Okiteru, một cậu bé chỉ mới ở độ tuổi tiểu học, đã mất đi cả cha lẫn mẹ và hiện đang sống cùng người anh trai vô công rồi nghề. Cuộc sống của cậu là một chuỗi ngày đen tối phải \"phục vụ\" cho những kẻ trưởng thành được anh mình đưa đến. Rồi một ngày, Okiteru nhận được tấm danh thiếp từ một cô bé đồng trang lứa vốn đã trở nên thân thiết với cậu tự bao giờ. Ẩn chứa trên tấm danh thiếp ấy là một bí mật, một bí mật gây sốc xoay quanh \"người lớn\", \"trẻ nhỏ\", và một thứ \"công lý\" có tác động rất lớn đến cuộc đời của các nhân vật trong câu chuyện này.','active',6,'2022-10-30 12:40:21','2022-10-30 12:40:22'),(40,'Tối Cường Thôn Phệ Hệ Thống','toi-cuong-thon-phe-he-thong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/40/toi-cuong-thon-phe-he-thong_1667030314.jpg','Đang Cập Nhật','Sau khi xuyên việt, Diệp Hiên tình cờ có được hệ thống thôn phệ, không chỉ có thể nuốt chửng vạn vật mà còn có thể đổi được huyết mạch, võ học, thần binh, đan dược, bảo vật... Thế này thì mạnh hết nấc luôn rồi! \"Đừng động vào ta, có tin ta nuốt mất thần khí bảo kiếm của ngươi không?\"','active',6,'2022-10-30 12:43:08','2022-10-30 12:43:10'),(41,'Destiny Unchain Online','destiny-unchain-online','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/41/destiny-unchain-online_1664106901.jpg','Đang Cập Nhật','Kou Mitsuki là một game thủ với những kỹ năng phải nói là quá ghê gớm, có biệt danh là \"Thợ săn táo Crim\". Cậu tham gia thử nghiệm một thiết bị trò chơi mới cho trò chơi mới mà do chính cha của cậu tạo ra, \"Destiny Unchained Online\". Nhưng trò chơi đầy lỗi khi bắt đầu và phá vỡ giấc mộng trở thành nam ma cà rồng cool ngầu của cậu. Gặp gỡ những đồng minh tuyệt vời và bắt đầu cuộc chơi như vũ bão, câu chuyện về một game thủ hàng đầu nơi mà mọi thứ hay bất kì cái gì đều có thể thay đổi... bắt đầu!','active',6,'2022-10-30 12:54:38','2022-10-30 12:54:39'),(42,'Pocket Monsters - Festival Of Champions','pocket-monsters-festival-of-champions','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/42/pocket-monsters-festival-of-champions_1584374109.jpg','Đang Cập Nhật','Kết hợp tính logic của game và sự ảo diệu của anime để một lần nữa kể lại câu chuyện của Red và Green','active',5,'2022-10-30 13:00:54','2022-10-30 13:00:55'),(43,'Hệ Thống Gánh Con Mạnh Nhất','he-thong-ganh-con-manh-nhat','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/43/he-thong-ganh-con-manh-nhat_1667117666.jpg','Đang Cập Nhật','Tần Xuyên phát hiện chỉ cần con của mình gây chuyện, hắn liền có thể mạnh lênThế là kiếp này, hắn bắt đầu troll con của mình đến cùng để tu tiên','active',4,'2022-10-30 22:40:47','2022-10-30 22:40:49'),(44,'Ousamatachi No Viking','ousamatachi-no-viking','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/44/ousamatachi-no-viking_1513084061.jpg','Đang Cập Nhật','Koreeda Kazuki, một hacker thiên tài 18 tuổi. Một ngày nọ, một người đàn ông giàu có đột ngột xuất hiện trước mặt cậu và tuyên bố rằng những kẻ lắm tiền nhiều của có thể chinh phục thế giới với tài năng hiếm có của Koreeda. Và rồi vượt qua mọi biên giới, hai nhà thám hiểm của kỷ nguyên mới đứng lên chống tội phạm trên phạm vi toàn cầu.','active',3,'2022-10-30 22:43:56','2022-10-30 22:43:57'),(45,'Dũng Sĩ Nấm','dung-si-nam','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/45/dung-si-nam_1666916378.jpg','Đang Cập Nhật','Wazi, một người chuyên nghiệp nhưng là một sinh viên đại học trung bình, được mời vào một ngày bởi các game thủ của anh ta. Tuy nhiên, anh ta bị một chiếc xe tải đâm vào. Tôi quyết định thay đổi cuộc sống của mình từ hôm nay trở đi, đây có phải là nó sẽ kết thúc như thế nào không? Không, tôi muốn sống cuộc sống trong những giấc mơ của mình…     Tôi đang ở đâu? Đây là nơi nào?  Chào mừng đến với Đại lục dũng cảm!  Tôi có biến thành nấm không? Làm thế nào tôi phải giết King Demon ?!  Câu chuyện về một loại nấm hèn nhát trong cuộc phiêu lưu của anh ta để trở thành một chiến binh bị áp đảo.','active',2,'2022-10-30 22:48:56','2022-10-30 22:48:57'),(46,'Con Gái Tôi Là Rồng!','con-gai-toi-la-rong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/46/con-gai-toi-la-rong_1663134318.jpg','Đang Cập Nhật','Jihoon đang sống một cuộc sống đang bị vắt kiệt bởi sự đòi hỏi của ông giáo sư, cho đến một ngày, con gái của anh ấy từ đâu mà đến! Vì ơn của Chaerin, một đứa trẻ thông minh và xinh đẹp như elf, mọi thứ đã bắt đầu tốt hơn đối với anh. Da dẻ của anh ta đã trở nên tốt hơn, cái nhìn và sự thông minh của anh ta cải thiện thấy rõ, và anh ta cũng đã trở nên cao hơn và đẹp trai hơn. Tất cả các việc này đề đã nắm trong kế hoạc của Chaerin! Jihoon','active',1,'2022-10-30 22:56:01','2022-10-30 22:56:02'),(47,'Quỷ Troll Mạnh Nhất Thế Giới','quy-troll-manh-nhat-the-gioi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/47/quy-troll-manh-nhat-the-gioi_1666882921.jpg','Đang Cập Nhật','Truyện tranh Quỷ Troll Mạnh Nhất Thế Giới được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Quỷ Troll Mạnh Nhất Thế Giới.','active',7,'2022-10-30 23:03:36','2022-10-30 23:03:36'),(48,'Trò Chơi Hệ Chữa Trị Của Tôi','tro-choi-he-chua-tri-cua-toi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/48/tro-choi-he-chua-tri-cua-toi_1667030696.jpg','Đang Cập Nhật','Hàn Phi là diễn viên hài thất nghiệp do không thể cười được. Được một ông chủ cửa hàng game giới thiệu trò Cuộc sống hoàn mỹ, từ đó bước chân vào thế giới địa ngục ma quái không lối thoát, từ một người bị bệnh sợ xã hội trở thành người đi lắng nghe giúp đỡ cá các linh hồn giải oan. Chiến đấu với các thế lực ma quái muốn thâu tóm thế giới. (Truyện chuyển thể từ tiểu thuyết cùng tên đã ra hơn 800 chap, nam chính không ngựa đực harem thấy gái nào cũng sáng mắt sấn sổ. Nữ chính vừa mạnh vừa đẹp, vừa giỏi nấu ăn, vừa không tsundere, không ngông cuồng lố lăng)','active',7,'2022-10-30 23:13:31','2022-10-30 23:13:31'),(49,'Ta Giả Thành Npc Tại Thế Giới Tiên Hiệp','ta-gia-thanh-npc-tai-the-gioi-tien-hiep','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/49/ta-gia-thanh-npc-tai-the-gioi-tien-hiep_1667030167.jpg','Đang Cập Nhật','Tần thiên là một người xuyên không đến tu tiên giới, với kiến thức về thời hiện đại của mình và kim ấn khai tông, cậu bắt đầu thành lập đệ nhất tông môn cho riêng mình','active',7,'2022-10-30 23:28:14','2022-10-30 23:28:15'),(50,'Tối Cường Kiếm Thần Trọng Sinh Ký','toi-cuong-kiem-than-trong-sinh-ky','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/50/toi-cuong-kiem-than-trong-sinh-ky_1662124706.jpg','Đang Cập Nhật','Cao thủ hàng đầu trong trò chơi thịnh hành toàn cầu \"Thần Vực\" - Thạch Phong bị câu lạc bộ phản bội. Mượn rượu giải sầu, khi tỉnh lại Thạch Phong phát hiện bản thân đã quay về mười năm trước, trở lại cái ngày mà trò chơi \"Thần Vực\" vừa mới được lên kệ. Sở hữu mười năm kinh nghiệm trong trò chơi, Thạch Phong mang theo hồi ức ngày xưa làm lại từ đầu, bắt đầu quay về với đỉnh phong chi lộ. Lần này, hắn sẽ không bị người khác điều khiển nữa. Kiếp này, hắn phải leo lên đỉnh cao hơn.','active',7,'2022-10-30 23:33:45','2022-10-30 23:33:46'),(51,'Kẻ Phản Diện Vô Song','ke-phan-dien-vo-song','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/51/ke-phan-dien-vo-song_1666169239.jpg','Đang Cập Nhật','Khi tôi tỉnh dậy, tôi phát hiện mình đã trở thành nhân vật phản diện trong cuốn tiểu thuyết võ thuật do chính tôi sáng tác! Nhưng có bao nhiêu là nhân vật, sao tôi lại xuyên vào một phản diện cơ chứ? Hyuk Ryun Woon: Con trai thứ tư của người đứng đầu Quỷ Đạo Một tay chơi phóng đãng Một phái võ thuật ngày càng suy đồi Một tên phản diện vô dụng bị nhân vật chính bắn hạ trong tiểu thuyết! Nếu tôi không muốn bị nhân vật chính giết, tôi phải trở nên mạnh hơn. “Hừ. Nhân vật chính gì chứ, ta sẽ đánh bại hết!” Một giai thoại về một nhân vật phản diện không cam chịu số phận, tìm mọi cách để sống sót!','active',7,'2022-10-31 19:40:50','2022-10-31 19:40:54'),(52,'Chainsawman Phần 2','chainsawman-phan-2','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/52/chainsawman-phan-2_1662031576.jpg','Đang Cập Nhật','Cái tên nói lên tất cả! Cuộc sống nghèo khó của Denji đã thay đổi mãi mãi khi anh hợp nhất với chú chó cưa máy cưng của mình, Pochita! Bây giờ anh ta đang sống ở thành phố lớn và là một Thợ săn Quỷ chính thức. Nhưng anh ấy có rất nhiều điều để tìm hiểu về công việc mới và khả năng cưa máy của mình!','active',7,'2022-10-31 19:51:55','2022-10-31 19:51:56'),(53,'Vương Tử Huyền Bí','vuong-tu-huyen-bi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/53/vuong-tu-huyen-bi_1666167414.jpg','Đang Cập Nhật','20 vương tử, 1 ngai vàng. Giữa cuộc đối đầu gay gắt, một âm mưu dần được vén màn, trái ngược với những gì công chúng đã biết, ánh nhìn theo dõi của kẻ thù hiện lên ngày càng nổi bật…','active',8,'2022-10-31 19:59:43','2022-10-31 19:59:43'),(54,'Chào Mừng Đến Với Lớp Học Đề Cao Thực Lực Năm 2','chao-mung-den-voi-lop-hoc-de-cao-thuc-luc-nam-2','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/54/chao-mung-den-voi-lop-hoc-de-cao-thuc-luc-nam-2_1664886443.jpg','Đang Cập Nhật','Năm 2 học thứ 2 của Ayanokouji tại ngôi trường cao trung giáo dục nâng cao Tokyo Sau khi hoàn thành xong [Bài thi đặc biệt] cuối năm nhất và thoát khỏi dã tâm của Tsukishiro, Ayanokouji lên năm hai Cao Trung Koudo Ikusei bình yên vô sự. Sau kì nghỉ xuân ngắn ngủi, lễ nhập học được tổ chức. Tháng 4 năm đó những học sinh năm nhất dần dần lộ diện. Những học sinh mới với vô vàn tính cách độc đáo không kém cạnh gì năm hai, dự rằng sẽ mang một làn sóng mới vào trường cao trung này. Đó là chưa kể... Năm nay, có một vị khách không mời từ White Room cử đến. Những cuộc đối đầu trong kì thi với những lớp năm hai khác, một bước đệm để nhắm đến vị trí lớp A. Thoát khỏi những âm mưu xấu xa của Tsukishiro và vị khách không mời đó, cùng theo đó là những mối quan hệ diễn ra trong trường...  Những ngày tháng đầy chông gai của năm thứ 2 đã bắt đầu...','active',8,'2022-10-31 20:08:32','2022-10-31 20:08:33'),(55,'Vùng Cấm','vung-cam','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/55/vung-cam_1592019520.jpg','Đang Cập Nhật','Truyện được Khôi Quỷ Các thực hiện. Đăng sớm nhất tại Nettruyen và fanpage KHôi Quỷ Các.Lịch ra chap: thứ 3 và thứ 5 hàng tuần.Thảm kịch của thành phố bị che phủ bởi một lớp màn bí mật. Khi trở về thành phố mình từng sống, Vũ Kiệt bị cuốn vào những thay đổi đột ngột. Và Tô Ngôn Hy- chàng trai anh từng yêu trở nên vừa quen thuộc vừa xa lạ. Đằng sau những bí ẩn và cám dỗ, sự thật là gì?','active',8,'2022-10-31 20:18:59','2022-10-31 20:19:00'),(56,'Đại Phản Diện','dai-phan-dien','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/56/dai-phan-dien_1656929797.jpg','Đang Cập Nhật','Main tên là Ân Vô Đạo...','active',8,'2022-10-31 20:30:57','2022-10-31 20:30:58'),(57,'Ai Cũng Có Thể Trở Thành Ác Nữ Phản Diện','ai-cung-co-the-tro-thanh-ac-nu-phan-dien','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/57/ai-cung-co-the-tro-thanh-ac-nu-phan-dien_1664981314.jpg','Đang Cập Nhật','Cô ấy đã hy sinh bản thân mình. Mặc dù cô ấy đã hiến mạng sống của mình như một nữ thần cho vương quốc… Một kết thúc buồn. “Cô chết cũng chẳng có ý nghĩa gì. Đừng chết. ” “Rốt cuộc, tất cả những gì tôi làm để cứu vương quốc chẳng là gì cả, vậy việc tôi tự cứu lấy mạng sống của mình có phải là một điều tồi tệ không?” Cô mím môi cười. “Vậy thì tôi sẽ rất vui khi trở thành một nhân vật phản diện.” Làm thế nào để trở thành một nhân vật phản diện ?!','active',8,'2022-10-31 20:37:10','2022-10-31 20:37:11'),(58,'Vương Giả Săn Mồi','vuong-gia-san-moi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/58/vuong-gia-san-moi_1663555729.jpg','Đang Cập Nhật','Truyện tranh Vương Giả Săn Mồi được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Vương Giả Săn Mồi.','active',8,'2022-10-31 20:45:16','2022-10-31 20:45:16'),(59,'Ta Ở Nhà 100 Năm Khi Ra Ngoài Đã Vô Địch','ta-o-nha-100-nam-khi-ra-ngoai-da-vo-dich','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/59/ta-o-nha-100-nam-khi-ra-ngoai-da-vo-dich_1665761223.jpg','Đang Cập Nhật','ta rõ ràng đã biến thành thiếu gia của một gia đình quyền lực trong thế giới giả tưởng, nhưng bị đuổi khỏi nhà tổ tiên và sống trong một sân vườn hẻo lánh! ? Chu Xuân không quan tâm chút nào, nhưng ta hệ thống càng ngày càng mạnh! Chỉ cần tôi ở nhà là đủ! Tôi có thể đủ mạnh mẽ! Đinh ~ ở nhà  một ngày, ban thưởng Kim Cương Bất Hoại thần công...... Đinh ~ ở nhà một năm, thưởng ban thưởng Ngọc Hư Tiên Kinh + Trăm năm tu vi...... Đinh ~ ở nhà  mười năm, ...... Ai cũng đừng nghĩ để cho ta Chu Xuân đi ra ngoài, ta liền muốn ở nhà đấy!','active',8,'2022-10-31 20:53:21','2022-10-31 20:53:22'),(60,'Bồi Hồi Giả','boi-hoi-gia','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/60/boi-hoi-gia_1663135088.jpg','Đang Cập Nhật','Mang trên mình hình dạng của một người đàn ông kỳ lạ ăn mặc như một nhân viên soát vé lang thang khắp các nhà ga và bên trong xe điện. Tất cả những ai nhìn thấy hình dạng của người đàn ông không rõ danh tính này cũng đều sẽ nhận một cái chết thảm thương dưới cây kéo lớn mà hắn ta đang cầm!! Tsukiko, một nữ sinh viên đại học vốn đang trải qua một đời sinh viên giản dị cùng người yêu của mình là Shu, cũng có thể nhìn thấy hắn...!','active',8,'2022-10-31 21:00:50','2022-10-31 21:00:51'),(61,'Tồn Tại Vĩnh Hằng','ton-tai-vinh-hang','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/61/ton-tai-vinh-hang_1661044973.jpg','Đang Cập Nhật','Một ngày nọ, nó là một đàn kiến, và một ngày nó là một con khủng long. Kiếp cuối cùng của một chúng sinh đã trải qua các kiếp khác nhau qua hàng vạn kiếp luân hồi. Anh ta được sinh ra như một con người với tất cả sức mạnh của các kiếp trước mà anh ta từng trải qua. Tại sao bạn có khả năng này? Izin cuối cùng cũng nhận ra. \'Tôi tồn tại để tiêu diệt loài người\'','active',9,'2022-10-31 21:10:39','2022-10-31 21:10:40'),(62,'Nàng Dâu Thượng Quỷ Tokyo','nang-dau-thuong-quy-tokyo','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/62/nang-dau-thuong-quy-tokyo_1665469509.jpg','Đang Cập Nhật','Mười năm trước, chàng trai trẻ Jinta hứa sẽ kết hôn với một cô gái. Và giờ anh ấy đã trưởng thành, một cô gái Oni lập dị xuất hiện trước cửa nhà anh ấy! Một bộ manga chiến đâu iu đương vui nhộn!','active',9,'2022-10-31 21:22:52','2022-10-31 21:22:55'),(63,'Lâu Đài Ma Vương Sudachi','lau-dai-ma-vuong-sudachi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/63/lau-dai-ma-vuong-sudachi_1639567454.jpg','Đang Cập Nhật','Sau khi dũng giả đánh bại ma vương, thế giới đã trở nên yên bình, nhưng sự yên bình ấy lại là gây ra mớ rắc rối cho cửa hàng vật phẩm của một thường dân. Nếu không có khách thì cửa hàng sẽ phải đóng cửa... Bỗng nhiên, một cô gái bí ẩn xuất hiện trước mặt cậu...','active',9,'2022-10-31 21:29:35','2022-10-31 21:29:36'),(64,'Tiên Giới Đệ Nhất Nội Ứng','tien-gioi-de-nhat-noi-ung','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/64/tien-gioi-de-nhat-noi-ung_1665745318.jpg','Đang Cập Nhật','Ta, Lâm Vân, căn cốt tuyệt hảo, có Tiên Đế chi tư, vốn cho rằng sẽ trở thành tông môn đệ tử bảo bối cung cấp, vạn vạn không nghĩ tới, bọn hắn để cho ta xâm nhập hang hổ đi nội ứng.Như vậy vấn đề tới, bắt đầu liền cầm xuống Ma Tôn làm sao bây giờ?Trưởng lão: \"Ta nói xâm nhập hang hổ không phải ý tứ này...\"','active',9,'2022-10-31 21:35:47','2022-10-31 21:35:48'),(65,'Đại Học Kinh Hoàng','dai-hoc-kinh-hoang','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/65/dai-hoc-kinh-hoang_1660826312.jpg','Đang Cập Nhật','Những hồn ma, những câu chuyện kinh dị được hiện thực hóa từ chính \"lòng tham\", \"dục tính\" của những sinh viên Đại học tuổi mới lớn.Chigarashi Mahina, một cô gái trầm tính liều mình lao đầu vào một buổi tiệc thác loạn trá hình của giới sinh viên hòng tìm cho bản thân một tình yêu để bù vào những năm tháng cấp ba không có thanh xuân của mình.Trong lúc vô ý đi vào một tòa nhà bỏ hoang, cô đã bị vô số hồn ma đáng sợ ám phải. Để rồi kết quả là mỗi lần đi ngủ, cô phải chịu đựng vô vàn những trận cưỡng hiếp tập thể hằng đêm bởi những hồn ma đó. Tuyệt vọng, cô tìm đến sự trợ giúp của Makube Kaoru, một \"chuyên gia\" bí ẩn trong khuôn viên trường Đại học mà cô đang theo học, hòng tìm kiếm sự cứu rỗi.Và đó chính là sự khởi đầu cho một đời sinh viên đầy kinh hoàng và chết chóc của cô...','active',9,'2022-10-31 21:41:01','2022-10-31 21:41:02'),(66,'Tôi May Mắn Triệu Hồi Được Tinh Linh Hộ Vệ Hạng 10','toi-may-man-trieu-hoi-duoc-tinh-linh-ho-ve-hang-10','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/66/toi-may-man-trieu-hoi-duoc-tinh-linh-ho-ve-hang-10_1667378543.jpg','Đang Cập Nhật','Truyện tranh Tôi May Mắn Triệu Hồi Được Tinh Linh Hộ Vệ Hạng 10 được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Tôi May Mắn Triệu Hồi Được Tinh Linh Hộ Vệ Hạng 10.','active',9,'2022-11-02 20:04:44','2022-11-02 20:04:49'),(67,'Ta Xưng Bá Chư Thiên Chỉ Dựa Vào Phòng Ngự','ta-xung-ba-chu-thien-chi-dua-vao-phong-ngu','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/67/ta-xung-ba-chu-thien-chi-dua-vao-phong-ngu_1667380396.jpg','Đang Cập Nhật','Thanh niên trương thần ngoài ý muốn trùng sinh về thời cấp 3 nhưng bất đồng ký ức chính là thế giới này chính là thế giới Linh khí khôi phục người người tập võ  cường thân kiện thể, tu chân dưỡng khí, để chống đỡ người ngoài hành tinh xâm lược, kinh hỉ là bản hack \"bị đánh hệ thống\" đã online, chỉ cần bị đánh là có thể mạnh lên, phòng ngự có thể Thu được nhiều quyền lực , địa vị,  tài phú , nam chính bị đánh thành chúa cứu thế','active',9,'2022-11-02 20:08:47','2022-11-02 20:08:48'),(68,'Cửu Thiên Kiếm Pháp','cuu-thien-kiem-phap','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/68/cuu-thien-kiem-phap_1667379671.jpg','Đang Cập Nhật','\"Ông ấy là chủ nhân của Cửu Thiên.\" Yeon Jeokha là con của một người vợ lẽ. Bị vợ của cha mình và các anh chị em của mình bắt nạt một cách tàn nhẫn, anh ta sau đó bị giam trong nhà kho sau khi cha anh ta qua đời vì bệnh tật… Đã mười năm kể từ khi anh ta trốn thoát sau khi anh ta học được môn võ thuật vượt ra ngoài thế giới. Cuộc phiêu lưu không thể ngăn cản của người kế thừa duy nhất của Cửu Thiên, Yeon Jeokha, bắt đầu ngay bây giờ!','active',10,'2022-11-02 20:12:00','2022-11-02 20:12:01'),(69,'Sekai Saikyou No Kouei: Meikyuukoku No Shinjin Tansakusha','sekai-saikyou-no-kouei-meikyuukoku-no-shinjin-tansakusha','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/69/sekai-saikyou-no-kouei-meikyuukoku-no-shinjin-tansakusha_1528602251.jpg','Đang Cập Nhật','Trợ lý Atobe Arihito ngủ thiếp đi trên chuyến xe bus, trong lúc di chuyển đến nơi nghỉ dưỡng của công ty. Khi tỉnh dậy, anh ta nhận ra mình đã chết vì tai nạn và được hồi sinh ở dị giới - Vương quốc Mê cung. Ngạc nhiên hơn, nhân vật chính của chúng ta đã gặp lại quản lý nghiện công việc, Igarashi Kyouka. Cô đã giải thích chi tiết nhiệm vụ của họ trong dị giới cho anh.     Ở Vương quốc Mê cung, người hồi sinh phải chọn một việc và gia nhập nhóm để chiến đấu với quái vật ở các Mê cung. \"Valkyrie\" Kyuoka mong Arihito quay lại làm việc với cô ấy, nhưng anh ta đã từ chối vì thấu hiểu sự khắt khe trong công việc của \"sếp cũ\". họ tạm biệt và cô thề rằng sẽ khiến anh hối hận vì không chọn cô. Từ đây, hành trình của Arihito bắt đầu.','active',10,'2022-11-02 20:17:00','2022-11-02 20:17:01'),(70,'Tầm Trảo Tiền Thế Chi Lữ 2','tam-trao-tien-the-chi-lu-2','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/70/tam-trao-tien-the-chi-lu-2_1666956243.jpg','Đang Cập Nhật','Phần 2 của Tầm Trảo Tiền Thế Chi Lữ','active',10,'2022-11-02 20:24:19','2022-11-02 20:24:20'),(71,'Tái Sinh Thành Quý Tộc Quyền Lực Nhất, Sở Hữu Sức Mạnh Được Sinh Ra Từ Phước Lành','tai-sinh-thanh-quy-toc-quyen-luc-nhat-so-huu-suc-manh-duoc-sinh-ra-tu-phuoc-lanh','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/71/tai-sinh-thanh-quy-toc-quyen-luc-nhat-so-huu-suc-manh-duoc-sinh-ra-tu-phuoc-lanh_1655289361.jpg','Đang Cập Nhật','Được chuyển sinh thành một hoàng tử thứ mười ba, Noah ban đầu không có tư cách can dự vào việc kế vị ngai vàng, vì vậy với lãnh thổ được giao phó, cậu sống tự do tự tạiTuy nhiên, vị thái tử kế thừa ngai vàng đã chết nên các hoàng tử còn lại tranh giành ngôi vị khá gay gắt .Noah, người có được sức mạnh mạnh nhất vì sống tự do như một hoàng tử, đã áp đảo các hoàng tử khác với sức mạnh đó và cuối cùng trở thành hoàng đế có quyền lực cao nhất trên trái đất.','active',10,'2022-11-02 20:34:38','2022-11-02 20:34:39'),(72,'Chuyển Sinh Thành Liễu Đột Biến','chuyen-sinh-thanh-lieu-dot-bien','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/72/chuyen-sinh-thanh-lieu-dot-bien_1663644307.jpg','Đang Cập Nhật','Ngu Tử Du bị chết sặc rồi chuyển sinh thành một cây liễu đột biến và bắt đầu hành trình phiêu lưu của mình.','active',10,'2022-11-02 20:44:07','2022-11-02 20:44:08'),(73,'Quốc Sư Không Sợ Hãi','quoc-su-khong-so-hai','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/73/quoc-su-khong-so-hai_1664764686.jpg','Đang Cập Nhật','Truyện tranh Quốc Sư Không Sợ Hãi được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Quốc Sư Không Sợ Hãi.','active',10,'2022-11-02 20:55:15','2022-11-02 20:55:16'),(74,'Yu-Gi-Oh! Ocg Stories','yu-gi-oh-ocg-stories','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/74/yu-gi-oh-ocg-stories_1657716224.jpg','Đang Cập Nhật','Những lá bài huyền bí ẩn chứa sức mạnh cổ đại. Bên trong lá bài này, mỗi người có thể thoáng thấy được một phần của thế giới trải dài vô hạn. Đây là một câu chuyện trong thế giới đó, câu chuyện về \"Thiểm Đao - Sky Striker\". ... Không giống với những bộ truyện Yu-Gi-Oh! trước đây, OCG Stories là một bộ truyện hoàn toàn mới, xoay quanh sự kiện, cốt truyện của các tộc bài hiện tại trong Yu-Gi-Oh!, với phần đầu tiên xoay quanh cốt truyện của tộc bài \"Sky Striker\", và những tộc bài khác ở các chương tiếp theo...','active',10,'2022-11-02 21:02:31','2022-11-02 21:02:31'),(75,'Player Thần Vực','player-than-vuc','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/75/player-than-vuc_1658576900.jpg','Đang Cập Nhật','Truyện tranh Player Thần Vực được cập nhật nhanh và đầy đủ nhất tại TruyenQQ. Bạn đọc đừng quên để lại bình luận và chia sẻ, ủng hộ TruyenQQ ra các chương mới nhất của truyện Player Thần Vực.','active',10,'2022-11-02 21:13:13','2022-11-02 21:13:14'),(76,'The Chronicles Of The Misfit Quartet And Their Unrivaled Synergy','the-chronicles-of-the-misfit-quartet-and-their-unrivaled-synergy','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/76/the-chronicles-of-the-misfit-quartet-and-their-unrivaled-synergy_1663143906.jpg','Đang Cập Nhật','Đúng với cái tên nói lên tất cả khi ta đọc qua phải nói cảm xúc chả khác gì đọc bộ chăn rau Ravi','active',10,'2022-11-02 21:19:04','2022-11-02 21:19:04'),(77,'Elden Ring: Đường Đến Với Cây Erdtree.','elden-ring-duong-den-voi-cay-erdtree','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/77/elden-ring-duong-den-voi-cay-erdtree_1663642873.jpg','Đang Cập Nhật','Hành trình của một Tarnished trên con đường đi tìm kiếm Elden Ring và trở thành vị chúa tể cai quản thế giới, Elden Lord. Một hành trình hài hước được dựa theo tựa game siêu phẩm Elden Ring của nhà phát triển From Software.','active',10,'2022-11-02 21:23:10','2022-11-02 21:23:12'),(78,'Stage S','stage-s','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/78/stage-s_1665407921.jpg','Đang Cập Nhật','Meguru Ukiyo đã phải lòng người bạn thời thơ ấu của mình, Sara Tatsumi. Một ngày nọ, anh tình cờ gặp một con rắn trắng ... nói rằng nó có thể nhìn thấy tương lai ?!','active',10,'2022-11-02 21:29:40','2022-11-02 21:29:41'),(79,'Âm Thanh Của Bầu Trời','am-thanh-cua-bau-troi','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/79/am-thanh-cua-bau-troi_1665930373.jpg','Đang Cập Nhật','Tatsumi đã nhanh chóng chấp nhận một công việc mới - làm giáo viên trên một hòn đảo nhỏ xung quanh Quần đảo Ogasawara tên là \"Aoshima\", nơi anh gặp phải những hiện tượng khó lường mà bất chấp mọi logic. Câu chuyện tưởng tượng ấm áp này là gợi lên sự bí ẩn và kì diệu của tự nhiên. Nhưng đây là một hòn đảo xanh đầy mê hoặc đang chào đón anh ấy, hay còn ẩn chứa một điều gì khác? Hòn đảo kêu gọi bạn, đưa bạn vào một thế giới siêu giác quan. Hãy tận hưởng chút phép màu này nhé!','active',10,'2022-11-02 21:37:04','2022-11-02 21:37:05'),(80,'Pháp Sư Phế Vật','phap-su-phe-vat','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/80/phap-su-phe-vat_1665130484.jpg','Đang Cập Nhật','Ở Fortelnia, một thế giới nơi sức mạnh là tất cả, có sức mạnh là làm bố của thiên hạ. Aruto, người chỉ có cấp bậc tồn tại thấp nhất [1☆], bất lực đến mức bạn gái Hanna của anh ta bị giết bởi Gamizin một tên pháp sư quyền năng nhất thế giới. Sau đó, Aruto, đã cố gắng đi từ đáy xã hội lên để báo thù và đạt max level nhưng lại hối tiếc vì quá khứ ? Sau khi chết đi và được chúa cho quay lại sống một lần nữa, với những ký ức đó thì làm sao main của chúng ta cứu được Hanna đây!','active',10,'2022-11-02 21:44:32','2022-11-02 21:44:33'),(81,'Chuyển Sinh Thành Tộc Trưởng Thời Kì Đồ Đá','chuyen-sinh-thanh-toc-truong-thoi-ki-do-da','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/81/chuyen-sinh-thanh-toc-truong-thoi-ki-do-da_1661006414.jpg','Đang Cập Nhật','Tô Bạch, một tiểu thuyết gia nổi tiếng, bị rơi từ một vách đá. Sau đó, anh ta chuyển sinh sang một thế giới khác, xã hội nguyên thủy, và sử dụng hệ thống hỗ trợ hàng ngày và kiến ​​thức của xã hội hiện đại, anh đã dẫn dắt bộ lạc nguyên thủy thoát khỏi nghèo đói và biến nó thành một nền văn minh tiên tiến!da','active',9,'2022-11-03 19:55:23','2022-11-03 19:55:26'),(82,'Long Ấn Chiến Thần','long-an-chien-than','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/82/long-an-chien-than_1667378956.jpg','Đang Cập Nhật','Thế giới bước vào thời đại thám hiểm vũ trụ, văn minh võ đạo hưng thịnh. Nhờ chiếc long ấn bí ẩn, một học sinh vô dụng đã trở thành thiên tài độc nhất vô nhị. dưới trời sao tương lai, làm thế nào thiếu niên này có thể bước lên sân khấu triều dâng sóng dậy, từng bước bước đến nơi cao nhất của bầu trời?','active',8,'2022-11-03 20:02:20','2022-11-03 20:02:21'),(83,'Ta Cần Phải Trở Thành Quái Vật','ta-can-phai-tro-thanh-quai-vat','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/83/ta-can-phai-tro-thanh-quai-vat_1662351803.jpg','Đang Cập Nhật','Tiêu Thu người âm thầm bảo vệ nhân loại một mình, không phải ai cũng hiểu. sau khi trải qua một cuộc sống đau buồn và được tái sinh, anh dấn thân vào con đường trở thành một con quái vật máu lạnh','active',7,'2022-11-03 20:07:33','2022-11-03 20:07:34'),(84,'Thiên Hạ Đệ Nhất Lữ Bố','thien-ha-de-nhat-lu-bo','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/84/thien-ha-de-nhat-lu-bo_1664885566.jpg','Đang Cập Nhật','Ngươi tin không? Nhân sinh của một người, từ tính cách ngươi hình thành một khắc này liền đã định trước, mặc dù nhân sinh sẽ có rất nhiều kỳ ngộ cùng rất nhiều lựa chọn, nhưng khi ngươi đối diện với mấy cái này kỳ ngộ cùng lựa chọn thời điểm, tính cách của ngươi cùng nhận thức đã được quyết định từ lâu ngươi sẽ lựa chọn như thế nào, làm một đã định trước kẻ thất bại, ngài có nguyện ý hay không từ giờ trở đi tái tạo nhân sinh cuộc sống của ngài? Nhân sinh máy mô phỏng, thay đổi tương lai, thay đổi nhân sinh, ngươi đáng giá nắm giữ. Thành Lạc Dương bên ngoài, Lữ Bố dạng chân tại ngựa Xích Thố bên trên theo đội ngũ chạy tại rộng rãi dịch đạo phía trên, trong đầu cái kia giống như như ác mộng tin tức lại lần nữa vọt tới, bên tai còn có cái kia muốn ăn đòn âm thanh không ngừng quanh quẩn, không nhiều, nhưng lại nhiều lần không ngừng mà nói, giống như mùa hè ruồi muỗi đồng dạng tại ngươi bên tai không ngừng thoáng qua, vẫn đánh không chết, để Lữ Bố phiền muộn không chịu nổi.','active',7,'2022-11-03 20:17:42','2022-11-03 20:17:45'),(85,'What Do You Wish For With Those Murky Eyes','what-do-you-wish-for-with-those-murky-eyes','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/85/what-do-you-wish-for-with-those-murky-eyes_1659785228.jpg','Đang Cập Nhật','Một ngày nọ, Raizou Takakura, một người làm công ăn lương bình thường lên cơn đau tim và chết. Tuy nhiên anh ta được ban tặng cuộc sống thứ hai ở thế giới khác. Trong khi các bộ isekai ăn liền khác được chuyển sinh với sức mạnh vô song thì nhân vật chính không được may mắn như vậy anh ta được chuyển sinh với thân phận là tên lính thấp hèn ở một quốc gia nhỏ, đế quốc Highserk và với thân phận mới bị đẩy ra tiền tuyến phủ đầy máu và xác thịt trải qua những lần thập tử nhất sinh dần dần thức tỉnh kỹ năng.','active',6,'2022-11-03 20:27:44','2022-11-03 20:27:45'),(86,'Soara Và Ngôi Nhà Cho Quái Vật','soara-va-ngoi-nha-cho-quai-vat','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/86/soara-va-ngoi-nha-cho-quai-vat_1656658767.jpg','Đang Cập Nhật','Cô bé mồ côi Soara được nhặt bởi một người lính trong vương quốc với \"Sứ mệnh\" là tiêu diệt quái vật. Nhưng một ngày, hòa bình được lặp lại, \"Sứ mệnh\" bị bãi bỏ, cô sẽ làm gì tiếp theo ???','active',5,'2022-11-03 20:35:41','2022-11-03 20:35:42'),(87,'Thần Sát Quỷ Vương','than-sat-quy-vuong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/87/than-sat-quy-vuong_1658281421.jpg','Đang Cập Nhật','Chúa quỷ sau khi thất bại thách thức thần linh đã đầu thai thành giống loài yếu nhất - loài người và tiếp tục con đường đi gõ đầu mấy thằng thần. Diễn biến như thế nào thì mọi người cùng chờ và đón xem nhoa.','active',4,'2022-11-03 20:41:48','2022-11-03 20:41:49'),(88,'Bộ Giáp Tai Ương','bo-giap-tai-uong','https://myanime-comic.sgp1.cdn.digitaloceanspaces.com/88/bo-giap-tai-uong_1661317719.jpg','Đang Cập Nhật','Trong thế giới này, cấp độ là thứ quyết định mọi thứ. Đây là một thế giới nơi những con quái vật nguy hiểm đi lang thang khắp các vùng đất và các mạo hiểm giả kiếm sống bằng cách tiêu diệt chúng. Với cấp độ là biểu tượng của sức mạnh tuyệt đối, những người có cấp cao hơn sẽ có được sự giàu có và danh tiếng trong khi những người có cấp thấp hơn thì làm tay sai nô lệ. Nhân vật chính, Alca, được gọi là \"kẻ lượm nhặt xác chết\" vì kỹ năng \"không thể nhận điểm kinh nghiệm\" của anh ta, điều này đã ngăn cản anh tăng cấp, khiến anh ta trở thành kẻ ăn mày ở đáy xã hội. Bỗng một ngày anh ta đã lấy được \"áo giáp địa ngục\", một bộ áo giáp của tai họa. Bộ giáp này làm cho anh ta có thể hấp thu cấp của kẻ khác chuyển thành cấp của mình \"Với sức mạnh này, tất cả những người cản đường tôi sẽ là ......\"','active',1,'2022-11-03 20:51:03','2022-11-03 20:51:04');
